trata de la conferencia m\\u00e1s importante de Latinoam\\u00e9rica que promueve el uso de Smalltalk en todas las \\u00e1reas relativas a educaci\\u00f3n,investigaci\\u00f3n cient\\u00edfica y desarrollo profesional,conectando Argentina y la regi\\u00f3n con la comunidad de Smalltalk internacional.<\\/p><p>Smalltalk es uno de los lenguajes de programaci\\u00f3n pionero en el desarrollo orientado a objetos,m\\u00e1s poderoso,productivo,y simple del mundo.\\u00a0<\\/p><p>Por otro lado,Argentina es reconocida a nivel mundial en el desarrollo Orientado a Objetos.<\\/p><p>Las conferencias se desarrollar\\u00e1n en dos formatos:\\u00a0<strong>Lunes 11 (en Laboratorio 3 de FAEA) y Martes 12 (en Laboratorio de Biblioteca) se realizar\\u00e1n talleres,y del Mi\\u00e9rcoles 13 al Viernes 15 charlas plenarias en el Aula Magna<\\/strong>.<\\/p><p>Durante las conferencias habr\\u00e1n charlas de todos los niveles,donde se tratar\\u00e1n temas como IoT,desarrollo web,mobile,testing,TDD,VM,frameworks,programaci\\u00f3n concurrente,machine learning,python bridge,.NET interoperability,API Rest,frameworks,productos educativos y de la industria,y mucho m\\u00e1s.<\\/p><p>Mariano Martinez Peck nos lo cuenta <a href=\\\"https:\\/\\/youtu.be\\/nLSnY1sHJWg\\\">aqu\\u00ed<\\/a>:<\\/p><p><strong>\\u00bfQu\\u00e9 hay que hacer para participar?<\\/strong><\\/p><ul><li>Para inscribirte en las conferencias pod\\u00e9s hacerlo desde el\\u00a0<a href=\\\"https:\\/\\/docs.google.com\\/forms\\/d\\/e\\/1FAIpQLSeEw7e_8aG1xo_YI3Vn7bJVy7YO_OeLx5BLyq2oO7Es6HLSLA\\/viewform\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Link de inscripci\\u00f3n a las conferencias<\\/a><\\/li><\\/ul><ul><li>Para inscribirte en los talleres\\u00a0<a href=\\\"https:\\/\\/forms.gle\\/j6prbioe4e9F4Kf77\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">https:\\/\\/forms.gle\\/j6prbioe4e9F4Kf77<\\/a><\\/li><\\/ul><ul><li>Pod\\u00e9s ver la agenda aqu\\u00ed:\\u00a0<a href=\\\"https:\\/\\/smalltalks2019.fast.org.ar\\/schedule\\\" 