\">https:\\/\\/forms.gle\\/j6prbioe4e9F4Kf77<\\/a><\\/li><\\/ul><ul><li>Pod\\u00e9s ver la agenda aqu\\u00ed:\\u00a0<a href=\\\"https:\\/\\/smalltalks2019.fast.org.ar\\/schedule\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">https:\\/\\/smalltalks2019.fast.org.ar\\/schedule<\\/a>\\u00a0o\\u00a0<p><a href=\\\"https:\\/\\/drive.google.com\\/file\\/d\\/0B56gxpighnxedjh0bDlxZVZFWlllV2wzVGJQWUN4X2xvU1ZR\\/view\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">https:\\/\\/drive.google.com\\/file\\/d\\/0B56gxpighnxedjh0bDlxZVZFWlllV2wzVGJQWUN4X2xvU1ZR\\/view<\\/a><\\/p><\\/li><li><p>Cualquier otra informaci\\u00f3n que requieras sobre las conferencias pod\\u00e9s escribirnos a\\u00a0<span id=\\\"cloak41148fddcff3c73bfa9dc324fa7346e1\\\"><a href=\\\"mailto:info@fast.org.ar\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">info@fast.org.ar<\\/a><\\/span>\\u00a0o\\u00a0<span id=\\\"cloak9f717b1ed1719f4d0977349cc278b1c8\\\"><a href=\\\"mailto:smalltalks2019@fi.uncoma.edu.ar\\\">smalltalks2019@fi.uncoma.edu.ar<\\/a><\\/span>\\u00a0<\\/p><\\/li><\\/ul><p>\\u00a0<\\/p><p>\\u00a0<\\/p>\"},          \"elements\":[],          \"widgetType\":\"text-editor\"}],          \"isInner\":false}],          \"isInner\":false}]'),          (705,          144,          '_elementor_elements_usage',          'a:3:{s:11:\"text-editor\";i:1;s:6:\"column\";i:1;s:7:\"section\";i:1;}'),          (707,          148,          '_wp_attached_file',          '2019/11/Smalltalks-Final.jpg'),          (708,          148,          '_wp_attachment_metadata',          'a:5:{s:5:\"width\";i:2251;s:6:\"height\";i:2250;s:4:\"file\";s:28:\"2019/11/Smalltalks-Final.jpg\";s:5:\"sizes\";a:4:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:28:\"Smalltalks-Final-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:28:\"Smalltalks-Final-300x300.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:12:\"medium_large\";a:4:{s:4:\"