9 20:23:21',          '<p style=\"margin-bottom: 10px; color: #444444; font-family: Verdana,sans-serif; font-size: 12px; text-align: justify;\">El próximo <strong><em>Jueves 29 y Viernes 30 de Agosto </em></strong>a partir de las 16 hs,          <strong><em> </em></strong>se realizarán las <strong><em>3º Jornadas de Investigación y Extensión de la FAI</em> </strong>en el Salón Azul de la Biblioteca Central. Se trata del evento más importante que tiene la FAI para comunicar a los estudiantes y comunidad informática en general la tarea diaria en investigación,extensión y posgrado,de forma de incentivar su participación en estas actividades.</p><p style=\"margin-bottom: 10px; color: #444444; font-family: Verdana,sans-serif; font-size: 12px; text-align: justify;\">En esta ocasión habrá varias charlas de empresas y organizaciones que contarán en que están trabajando,qué perfiles informáticos busca la industria,que tareas y tecnologías utilizan,etc. Además se realizarán sorteos con premios donados por empresas que acompañan el evento. </p><p style=\"margin-bottom: 10px; color: #444444; font-family: Verdana,sans-serif; font-size: 12px;\"> Esperamos contar con la presencia de todos!!</p>		\n											<a href=\"http://cefai.fi.uncoma.edu.ar/wp-content/uploads/2019/08/3Jornada-de-Investigación-y-ExtensiónFAI.png\" data-elementor-open-lightbox=\"no\">\n							<img width=\"1587\" height=\"2245\" src=\"http://cefai.fi.uncoma.edu.ar/wp-content/uploads/2019/08/3Jornada-de-Investigación-y-ExtensiónFAI.png\" alt=\"\" srcset=\"http://cefai.fi.uncoma.edu.ar/wp-content/uploads/2019/08/3Jornada-de-Investigación-y-ExtensiónFAI.png 1587w,http://cefai.fi.uncoma.edu.ar/wp-content/uploads/2019/08/3Jornada-de-Investigación-y-ExtensiónFAI-212x300.png 212w,http://cefai.fi.uncoma.edu.ar/wp-content/uploads/2019/08/3Jornada-de-Investigación-y-ExtensiónFAI-768x1086.png 768w,http://cefai.fi.uncoma.edu.ar/wp-content/uploads/2019/08/3Jornada-de-Investigación-y-ExtensiónFAI-724x1024.png 724w\" sizes=\