l uso de Smalltalk en todas las áreas relativas a educación,investigación científica y desarrollo profesional,conectando Argentina y la región con la comunidad de Smalltalk internacional.\n\nSmalltalk es uno de los lenguajes de programación pionero en el desarrollo orientado a objetos,más poderoso,productivo,y simple del mundo.&nbsp;\n\nPor otro lado,Argentina es reconocida a nivel mundial en el desarrollo Orientado a Objetos.\n\nLas conferencias se desarrollarán en dos formatos:&nbsp;<strong>Lunes 11 (en Laboratorio 3 de FAEA) y Martes 12 (en Laboratorio de Biblioteca) se realizarán talleres,y del Miércoles 13 al Viernes 15 charlas plenarias en el Aula Magna</strong>.\n\nDurante las conferencias habrán charlas de todos los niveles,donde se tratarán temas como IoT,desarrollo web,mobile,testing,TDD,VM,frameworks,programación concurrente,machine learning,python bridge,.NET interoperability,API Rest,frameworks,productos educativos y de la industria,y mucho más.\n\nMariano Martinez Peck nos lo cuenta <a href=\"https://youtu.be/nLSnY1sHJWg\">aquí</a>:\n\n<strong>¿Qué hay que hacer para participar?</strong>\n<ul>\n 	<li>Para inscribirte en las conferencias podés hacerlo desde el&nbsp;<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSeEw7e_8aG1xo_YI3Vn7bJVy7YO_OeLx5BLyq2oO7Es6HLSLA/viewform\" target=\"_blank\" rel=\"noopener noreferrer\">Link de inscripción a las conferencias</a></li>\n</ul>\n<ul>\n 	<li>Para inscribirte en los talleres&nbsp;<a href=\"https://forms.gle/j6prbioe4e9F4Kf77\" target=\"_blank\" rel=\"noopener noreferrer\">https://forms.gle/j6prbioe4e9F4Kf77</a></li>\n</ul>\n<ul>\n 	<li>Podés ver la agenda aquí:&nbsp;<a href=\"https://smalltalks2019.fast.org.ar/schedule\" target=\"_blank\" rel=\"noopener noreferrer\">https://smalltalks2019.fast.org.ar/schedule</a>&nbsp;o<a href=\"https://drive.google.com/file/d/0B56gxpighnxedjh0bDlxZVZFWlllV2wzVGJQWUN4X2xvU1ZR/view\" target=\"_blank\" rel=\"noopener noreferrer\">https://drive.google.com/file/d/0B56gxpighnxedjh0bDlxZVZFWlllV2wzVGJQWUN4X2xvU1ZR/view</a></li>\n 	<li>Cualquier otra información que requieras sobre las conferencias podés escribirnos a&nbsp;<a href=\"mailto:info@fast.org.ar\" target=\"_blank\" rel=\"noopener noreferrer\">info@fast.org.ar</a>&nbsp;o&nbsp;<a href=\"mailto:smalltalks2019@fi.uncoma.edu.ar\">smalltalks2019@fi.uncoma.edu.ar</a>&nbsp;</li>\n</ul>',          'SMALLTALKS 2019 en la FAI',          '',          'publish',          'open',          'open',          '',          'smalltalks-2019-en-la-fai',          '',          '',          '2019-11-06 12:17:16',          '2019-11-06 15:17:16',          '',          0,          'http://cefai.fi.uncoma.edu.ar/?p=144',          0,          'post',          '',          0),          (145,          1,          '2019-11-06 12:13:11',          '2019-11-06 15:13:11',          '',          'SMALLTALKS 2019 en la FAI',          '',          'inherit',          'closed',          'closed',          '',          '144-revision-v1',          '',          '',          '2019-11-06 12:13:11',          '2019-11-06 15:13:11',          '',          144,          'http://cefai.fi.uncoma.edu.ar/2019/11/06/144-revision-v1/',          0,          'revision',          '',          0),          (146,          1,          '2019-11-06 12:14:01',          '2019-11-06 15:14:01',          '{{unknown}}',          '',          '',          'publish',          'closed',          'closed',          '',          '057d424109d4f8a04d949762138064ce',          '',          '',          '2019-11-06 12:14:01',          '2019-11-06 15:14:01',          '',          0,          'http://cefai.fi.uncoma.edu.ar/2019/11/06/057d424109d4f8a04d949762138064ce/',          0,          'oembed_cache',          '',          0),          (147,          1,          '2019-11-06 12:16:41',          '2019-11-06 15:16:41',          '<p>La FAST y la Facultad de Informática los invitan a las <strong>13° Conferencias de Tecnología,Investigación y productos basados en Smalltalk,           </strong>que se realizará del <strong>11 al 15 de Noviembre</strong> en la Universidad Nacional del Comahue. Es libre y gratuita.</p><p><a href=\"https://smalltalks2019.fast.org.ar/\">smalltaksWeb</a></p><p>Se trata de la conferencia más importante de Latinoamérica que promueve el uso de Smalltalk en todas las áreas relativas a educación,investigación científica y desarrollo profesional,conectando Argentina y la región con la comunidad de Smalltalk internacional.</p><p>Smalltalk es uno de los lenguajes de programación pionero en el desarrollo orientado a objetos,más poderoso,productivo,y simple del mundo. </p><p>Por otro lado,Argentina es reconocida a nivel mundial en el desarrollo Orientado a Objetos.</p><p>Las conferencias se desarrollarán en dos formatos: <strong>Lunes 11 (en Laboratorio 3 de FAEA) y Martes 12 (en Laboratorio de Biblioteca) se realizarán talleres,y del Miércoles 13 al Viernes 15 charlas plenarias en el Aula Magna</strong>.</p><p>Durante las conferencias habrán charlas de todos los niveles,donde se tratarán temas como IoT,desarrollo web,mobile,testing,TDD,VM,frameworks,programación concurrente,machine learning,python bridge,.NET interoperability,API Rest,frameworks,productos educativos y de la industria,y mucho más.</p><p>Mariano Martinez Peck nos lo cuenta <a href=\"https://youtu.be/nLSnY1sHJWg\">aquí</a>:</p><p><strong>¿Qué hay que hacer para participar?</strong></p><ul><li>Para inscribirte en las conferencias podés hacerlo desde el <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSeEw7e_8aG1xo_YI3Vn7bJVy7YO_OeLx5BLyq2oO7Es6HLSLA/viewform\" target=\"_blank\" rel=\"noopener noreferrer\">Link de inscripción a las conferencias</a></li></ul><ul><li>Para inscribirte en los talleres <a href=\"https://forms.gle/j6prbioe4e9F4Kf77\" target=\"_blank\" rel=\"noopener noreferrer\">https://forms.gle/j6prbioe4e9F4Kf77</a></li></ul><ul><li>Podés ver la agenda aquí: <a href=\"https://smalltalks2019.fast.org.ar/schedule\" target=\"_blank\" r